import React from "react";
import {Chart} from 'primereact/chart';

export default function Pie1() {

  const data = {
    labels: ['Positive','Total'],
    datasets: [
        {
            data: [960,320],
            backgroundColor: [
                "#1cc0b0"
            ],
            hoverBackgroundColor: [
                "#1cc0b0"
            ]
        }]
    };
    return (
      <div>
      <Chart width="50" height="50" type="pie" data={data} />
  </div>
    );
  }
